import React from 'react';

const UserCard = ({ name, age, major, hobbies, careerAspirations }) => {
  const imageName = name.toLowerCase().replace(' ', '-');
  const imageSrc = `%PUBLIC_URL%/images/${imageName}-profile.jpg`;

  return (
    <div className="col-6 col-lg-3">
      <div className="user mb-4">
        <div className="user-body">
          <img className="pb-3 profile-image" src={imageSrc} alt={`Profile Picture of ${name}`} />
          <h2>{name}</h2>
          <p>Age: {age}</p>
          <p>Major: {major}</p>
          <p>Hobbies: {hobbies}</p>
          <p>Career Aspirations: {careerAspirations}</p>
          <a className="btn btn-dark" href="#">View Profile</a>
          <br />
          <button className="swipe-button swipe-left">Swipe Left</button>
          <a href="match.html">
            <button className="swipe-button swipe-right">Swipe Right</button>
          </a>
        </div>
      </div>
    </div>
  );
};

export default UserCard;
